import { fire } from './../firebase';

const Account = (props) => {
    const handleLogout = () => {
        fire.auth().signOut();
      };

    return (
        <section className = 'hero'>
            <nav>
                <h2>Welcome</h2>
                <button onClick = {handleLogout}>Logout</button>
            </nav>
        </section>
    );
}

export default Account;
